import React from 'react'
import { DoEventsData, EventData } from '../DoData'

interface EventProps {
    index: number
    events: DoEventsData
}

const EventThingy = ({ index, events }: EventProps) => {
    const event = events.events[index]
    const firstEventStartDate = new Date(event.start)
    const dayOfWeek = firstEventStartDate.getDay().toString()
    const startTime = firstEventStartDate.getHours() + ":" + firstEventStartDate.getMinutes()

    return <div>
        {index == 0 && <h1>{dayOfWeek}</h1>}
        {index == 0 && <h2>{startTime}</h2>}
        <div>{event.text}</div>
    </div>
}

export default EventThingy
